@csrf_exempt
def detectNumberPlate(request):
    try:
        if request.method != "POST":
            response = {
                "code" : 400,
                "message" : "BadRequest",
                "data" : []
            }
            return JsonResponse(response)

        if len(request.FILES) == 0:
            response = {
                "code": 404,
                "message": "FileNotFound",
                "data": []
            }
            return JsonResponse(response)

        if request.FILES.get("image", None) is not None:
            # grab the uploaded image
            file = request.FILES["image"]

            data = file.read()

            # convert the image to a NumPy array and then read it into
            # OpenCV format
            image = np.asarray(bytearray(data), dtype="uint8")

            originalImageAsBase64 = base64.b64encode(image).decode("ascii")
            image = cv2.imdecode(image, cv2.IMREAD_COLOR)
            #image = _grab_image(stream=file)

            try:
                #print(image)
                numberPlate = utils.getNumberPlate(image)

                if type(numberPlate) == type(None):
                    response = {
                        "code": 200,
                        "message": "success",
                        "data": {
                            "text": "unable to detect",
                            "image": noDataFoundBase64,
                            "originalImage": originalImageAsBase64
                        }
                    }
                    return JsonResponse(response)

                numberPlateText = utils.numberPlateToText(numberPlate)

                #cropedImageAsBase64 = base64.b64encode(numberPlate).decode("utf-8")
                retval, buffer = cv2.imencode('.jpg', numberPlate)
                cropedImageAsBase64 = base64.b64encode(buffer)
                cropedImageAsBase64 = cropedImageAsBase64.decode("ascii")

                response = {
                    "code": 200,
                    "message": "success",
                    "data": {
                        "text": numberPlateText,
                        "image": cropedImageAsBase64,
                        "originalImage": originalImageAsBase64
                    }
                }

                #print(f"response will be => {json.dumps(response)}")
                return JsonResponse(response)
            except Exception as err:
                print(err)
                pass

        response = {
            "code": 200,
            "message": "success",
            "data": {
                "text": "unable to detect",
                "image" : noDataFoundBase64,
                "originalImage": originalImageAsBase64
            }
        }
        return JsonResponse(response)

    except Exception as err:
        logger.error(f"Error while detect number plate : {err}")
        response = {
            "code" : 500,
            "message" : "internalServerError",
            "data" : {}
        }
        return JsonResponse(response)



